import React from 'react';
import '../MyInfo.css';

import Img from '../../../../assets/miclaude.png';

const PhotoUser = () => {
    return (
        <div className="BlockContainer">
            <div className="TitleBackground">
                <h4 className='h4'>Image Profil</h4>
            </div>
            <div className="BlockImage">
                <img src={Img} style={{ display:'flex', justifyContent:'center', alignwidth:'150px', height:'150px', borderRadius:'50%'}}alt=''/>
            </div>
        </div>
    )
}

export default PhotoUser;
